import logo from './logo.png'
import './App.css'

import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import { Container } from 'react-bootstrap'
import ScriptTag from 'react-script-tag';

import HomeScreen from './Screen/HomeScreen'

function App() {
  return (
    <div className="content-wrapper">
      <Router>
        <main>
            <Switch>
              <Route path="/" component={HomeScreen} exact />
            </Switch>
        </main>
      </Router>
      <ScriptTag isHydrating={true} type="text/javascript" src='./assets/js/plugins.js'/>
      <ScriptTag isHydrating={true} type="text/javascript" src='./assets/js/theme.js'/>
      <ScriptTag isHydrating={true} type="text/javascript" src='./assets/js/bootstrap.bundle.min.js'/>
      <ScriptTag isHydrating={true} type="text/javascript" src='./assets/js/jquery.min.js'/>
    </div>
    // <div className="App">
    //   <header className="App-header">
    //     <img src={logo} className="App-logo" alt="logo" />
    //     <p>
    //       Edit <code>src/App.js</code> and save to reload.
    //     </p>
    //     <a
    //       className="App-link"
    //       href="https://reactjs.org"
    //       target="_blank"
    //       rel="noopener noreferrer"
    //     >
    //       Learn React
    //     </a>
    //   </header>
    // </div>
  )
}

export default App
